import BullContainer from "./BullContainer";

const BullRow = ({upperStocks}) => {
    return(
        <div className="row">
           {upperStocks.map(data => {
                  <div className="upper symbol-box">
                  <h2 id="symbol">{data.name}</h2>
                  <p className="price">Price: ${data.price}</p>
                  <div className="changes-row">
                    <p className="">${data.percentage}%</p>
                    <img id="upArrow" src="./images/upArrow.svg"/>
                    <p>${data.change}</p>
                  </div>
                </div>
               })}    
        </div>
    )
}

export default BullRow;
